import "./App.css";
import { HomePage } from "./pages/homepage/homepage.page.jsx";
import { Route, Switch } from "react-router-dom";

const Hats = () => (
  <div>
    <h1>Hats</h1>
  </div>
);

function App() {
  return (
    <div className="App">
      <Route exact path="/" component={HomePage} />
      <Route path="/hats" component={Hats} />
    </div>
  );
}

export default App;
